import logo from '../images/logo.svg';

function Header() {

  function renderHeaderFrame() {
    return (
      <header className="header">
        <img className="logo" src={logo} id="logo-icon" alt="logo"></img>
      </header>
    );
  }

  return renderHeaderFrame();
}

export default Header;
